window.bookSummaryJSON = "<p>Major Richards needs to get out of the Sol System. </p> <p></p> <p>Demoted by the military and hung out to dry, the media labels her the Butcher of Toro. Despite her soiled record, Tanis still one of the best military counterinsurgency officers in the Terran Space Force. They need her to find the terrorists responsible for trying to destroy the GSS Intrepid, a massive interstellar colony ship in the final phases of construction at the Mars Outer Shipyards. </p> <p>It'll be her ticket out of the Sol system, but Tanis discovers she is up against more than mercenaries and assassins. Major corporations and governments have a vested interest in ensuring the Intrepid never leaves Sol, ultimately pitting Tanis against factions inside her own military. </p> <p>With few friends left, Tanis will need to fight for her life to get outsystem. </p>"; 
